import React from 'react';
import './App.css';
import Container from 'react-bootstrap/Container'
import Table from 'react-bootstrap/Table'

import axios from 'axios';

var obj;
var response;

var id;
var datetime;
var name;
var summary;
var url;
var type
var location;

var forecast;
var daily;
var pm25;
var today
var avg;

var elements;

export default class PersonList extends React.Component {
  state = {
    persons: []
  }

  componentDidMount() {
    axios.get('http://api.waqi.info/feed/stockholm/?token=6460bc98321176676eee4a2d07153eb8854628fe')
      .then(res => {
        obj = res.data;
        response = obj[Object.keys(obj)[1]];
        forecast = JSON.stringify(response[Object.keys(response)[7]]);
        daily = JSON.stringify(forecast[Object.keys(forecast)[0]]);
        pm25 = JSON.stringify(daily[Object.keys(daily)[2]]);
        today = JSON.stringify(pm25[Object.keys(pm25)[2]]);
        avg = JSON.stringify(today[Object.keys(today)[2]]);

        //avg = response[7][0][2][2][0]
        //response = obj[Object.keys(obj)[1]];
        // elements = {id: id, datetime: datetime, name: name, summary: summary, url: url, type: type, location: location}
        const persons = avg;
        this.setState({ persons });
      })
  }

  render() {
    return (
      <Container>
<Table striped bordered hover size="sm">
<thead>
  <tr>
    <th>Id</th>
    <th>Datetime</th>
    <th>Name</th>
    <th>Summary</th>
    <th>Url</th>
    <th>Type</th>
    <th>Location</th>
  </tr>
  </thead>
  <tbody>
  <tr>
    <td>{ this.state.persons}</td>
  </tr>
  </tbody>
</Table>
</Container>
    )
  }
}
